        .to('section.panel', 1, {
          x: '0%',
          y: '0%',
          scale: 1,
          ease: Power0.easeNone
        })
      const scene = new this.$scrollmagic.Scene({
        triggerElement: '.pinContainer',
        triggerHook: 'onLeave',
        offset: -82,
        duration: 5000
      })
        .setPin('.pinContainer')
        .setTween(tween)
      this.$ksvuescr.$emit('addScene', 'pinContainerScene', scene)
